import React from 'react';

const ContactPage = () => {
  return (
    <div>
      <h1>Contact Us</h1>
      <p>
        Get in touch with us to explore how we can assist you in achieving your goals in Dubai. Whether you have
        inquiries about our services, want to discuss partnership opportunities, or simply need more information, our
        team is here to provide personalized assistance and support.
      </p>
    </div>
  );
};

export default ContactPage;
